import React, { useState } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import campo1 from './src\pages\Cadastro\campo1.js';
import campo2 from './src\pages\Cadastro\campo2.js';
import campo3 from './src\pages\Cadastro\campo3.js';

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="CampoDeEntrada1">
        <Stack.Screen name="Campo1" component={Campo1} />
        <Stack.Screen name="Campo2" component={Campo2} />
        <Stack.Screen name="Campo3" component={Campo3} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
